// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import '@openzeppelin/contracts/access/Ownable.sol';
import './Data.sol';

contract Lottery is Ownable{
    Data data;//
    bool public pauseStatus;//

    //      owner    number     quantity    id()
    event GetPlay(address owner,uint256 number,uint256 qDuantity,bytes32 id);
    //     number
    event GetDraw(uint256 number);
    //     owner    number     quantity:      prize
    event GetExchange(address owner,uint256 number, uint quantity,uint256 prize);

    constructor (address dataContractAddress) {    //src\migrations\3_lottery.js
        pauseStatus= false; //
        data = Data(dataContractAddress);
        //data.transferOwnership(address(this));//
    }

    //data
    function transferOwnership() public onlyOwner {
        data.transferOwnership(msg.sender);
    }

    //
    function getbalance() public view returns(uint256) {
        return address(this).balance;
    }

    //
    modifier needPause() {
        require(!pauseStatus,'the contract is paused!');
        _;
    }

    //
    function setPaused(bool _pauseStatus) public onlyOwner {
        pauseStatus = _pauseStatus;
    }

    //
    function setUnitPrice(uint256 unitPrice) public onlyOwner{
        data.setUnitPrice(unitPrice);
    }

    //
    function getUnitPrice() public view returns(uint256) {
        return data.getUnitPrice();
    }

    //        bigPrize       smallPrize
    function setPrize(uint256 bigPrize,uint256 smallPrize) public onlyOwner {
        data.setPrize(bigPrize, smallPrize);
    }

    //
    function getBigPrize() public view returns(uint256){
        return data.getBigPrize();
    }

    //
    function getSmallPrize() public view returns(uint256){
        return data.getSmallPrize();
    }
    
    //     period
    function getSelectedTickets(uint period) view public returns(Data.lotteryInfo[] memory){
        return data.getSelectedTickets(msg.sender,period);
    }

    //
    function getOpenNumberList() view public returns(uint256[] memory){
        uint256[] memory openNumberList = data.getOpenNumberList();
        return openNumberList;
    }

    //
    function playRandom(uint256 quantity) public payable needPause {
        uint unitPrice = data.getUnitPrice();
        require(msg.value == unitPrice * quantity,'value is not correct');
        for (uint256 index = 0; index < quantity; index++) { 
            bytes memory b1 = abi.encodePacked(block.timestamp,block.difficulty,msg.sender); //
            bytes32 b2 = keccak256(b1); //Keccak256(SHA3)
            uint256 number = uint256(b2) % 10000; //4
            data.pushTickets(msg.sender,number,b2); //1
            emit GetPlay(msg.sender,number,1,b2); //
        }
    }

    //      number     quantity
    function play(uint256 number,uint256 quantity) public payable returns(uint256){
        uint unitPrice = data.getUnitPrice();
        require(msg.value == unitPrice * quantity,'value is not correct');
        data.pushTickets(msg.sender,number,quantity,0); //quantitynumber
        emit GetPlay(msg.sender,number,quantity,0); //
        return number; //
    }
    
    //
    function draw() public onlyOwner needPause {  //
        bytes memory b1 = abi.encodePacked(block.timestamp,block.difficulty,msg.sender); //
        bytes32 b2 = keccak256(b1); //Keccak256(SHA3)
        uint256 number = uint256(b2) % 10000; //4
        data.pushOpenNumberList(number); //
        emit GetDraw(number); //
    }

    //    number     period
    function exchange(uint256 number,uint256 period) public needPause returns(uint256){  //
        uint256[] memory tempList = data.getOpenNumberList(); //
        uint256 openNumber = tempList[period]; //period
        uint256 bigPrize = data.getBigPrize(); //
        uint256 smallPrize = data.getSmallPrize(); //
        uint256 totalPrize = 0;
        Data.lotteryInfo[] memory tempInfos = data.getSelectedTickets(msg.sender,period); //period
        for (uint256 index = 0; index < tempInfos.length; index++) {  //
            uint256 ownerNumber = tempInfos[index].number;
            if(ownerNumber == number){    //
                if(tempInfos[index].exchangeStatus) //
                        continue;
                data.setExchangeStatus(msg.sender,period,index,true); //
                if(number == openNumber){   //
                    uint256 prize = bigPrize * tempInfos[index].quantity;
                    payable(msg.sender).transfer(prize); //
                    data.setWinStatus(msg.sender,period,index,1); //
                    totalPrize += prize;
                    emit GetExchange(msg.sender,number,tempInfos[index].quantity,prize); //
                } else if((openNumber % 1000 == ownerNumber % 1000)  //33
                          || (openNumber % 1000 == ownerNumber / 10)       //33
                          || (openNumber / 10 == ownerNumber % 1000)       //33
                          || (openNumber / 10 == ownerNumber / 10)){          //33
                    uint256 prize = smallPrize * tempInfos[index].quantity;
                    payable(msg.sender).transfer(prize); //
                    data.setWinStatus(msg.sender,period,index,2); //
                    totalPrize += prize;
                    emit GetExchange(msg.sender,number,tempInfos[index].quantity,prize); //
                }
                else
                {
                    data.setWinStatus(msg.sender,period,index,0); //
                }
            }
        }

        return totalPrize;
    }

    //
    function setTicketTemp(uint256 period,uint256 number) public onlyOwner{
        data.pushTickets(msg.sender, period, number, 1, 0);
    }

    receive() external payable {}

}
